import React from 'react';
import classes from"./Header.module.css";

const Header = () => {
    return (
        <header className={classes.header}>
            <div className={classes.headerLogo}>
                <img src="https://sun9-37.userapi.com/c628321/v628321677/3bc35/Nw-jx5UJK5k.jpg  " alt="logo"></img>
            </div>
            <div className={classes.headerSearch}>
                <textarea></textarea>
            </div>
            <div className={classes.headerNotification}><img src="" alt="notification">></img></div>
            <div className={classes.headerMusic}>Music</div>
            <div className={classes.headerProfile}>Profile</div>    
        </header>
    );
}

export default Header;
